    false,nt"url": null,nt"notes": "The Light Detection and Ranging (LiDAR)
    LAS dataset is a survey of select areas within Southwest Florida. These data were
    produced for the Southwest Florida Water Management District (SWFWMD). Two SWFWMD
    datasets are included in this metadata record; they are Peace River South and Carter
    Creek. The Carter Creek portion of this data is a small data set in the northwestern
    part of Highlands County, which has been appended to the larger data set of Peace
    River South for ease of use within the NOAA Coastal Services Center (CSC) Lidar
    Data Retrieval Tool (LDART). Information that is specific to each data set has been
    maintained. PEACE RIVER SOUTH The Peace River South LiDAR (P692)Survey project area
    consists of approximately 1,801 square miles and covers Hardee and DeSoto Counties
    and portions of Highlands and Charlotte Counties. The LiDAR point cloud was flown
    at a density sufficient to support a maximum final post spacing of 6 feet for unobscured
    areas. 3001 inc. acquired 445 flightlines between February 11, 2005 and April 14,
    2005. The data was divided into 5000' by 5000' foot cells that serve as the tiling
    scheme. The Peace River South LiDAR Survey was collected under the guidance of a
    Professional Mapper/Surveyor. CARTER CREEK The Carter Creek LiDAR Survey project
    area consists of approximately 26 square miles and is located in northwestern Highlands
    County. The LiDAR point cloud was flown at a density sufficient to support a maximum
    final post spacing of 4 feet for unobscured areas. 3001 Inc. acquired 60 flightlines
    between February 6, 2006 and February 7, 2006. The data was divided into 5000' by
    5000' foot cells that serve as the tiling scheme. The Carter Creek LiDAR Survey
    was collected under the guidance of a Professional Mapper/Surveyor.",nt"license_title":
